def isPrime(x):
    if x<2:
        return False
    for i in range(2,x):
        if not x%i:
           return False
    return True

def doesItPass(x):
	random_int = random.randint(1, x)
	if x % random_int is 0:
		return True
	else:
		return False


def imgTranspose(im):
#	max_size = random.randint(1, im.size[0])
	max_size = im.size[0]

	for i in xrange(1, im.size[0], im.size[0]/max_size):
#		if isPrime(i):
		if doesItPass(i):
			box = (0, i, im.size[0]/1, im.size[1])
			region = im.crop(box)

			region = region.transpose(Image.ROTATE_180)
			if doesItPass(random.randint(1, im.size[0])):
				region = region.filter(ImageFilter.DETAIL)

			region = region.point(lambda i: i)

			im.paste(region, box)
	return im



